        return new Source("{% extends 'baseAdmin.html.twig' %}

{% block title %}Offer index{% endblock %}

{% block body %}
    <h1>Offer index</h1>
    <a href=\"{{ path('offer_new') }}\">Create new</a>
    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Created_at</th>
                <th>Department</th>
                <th>Description</th>
                <th>Zipcode</th>
                <th>City</th>
                <th>Company</th>
                <th>Contact_email</th>
                <th>Reference</th>
                <th>Latitude</th>
                <th>Longitude</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for offer in offers %}
            <tr>
                <td>{{ offer.id }}</td>
                <td>{{ offer.createdAt ? offer.createdAt|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ offer.department }}</td>
                <td>{{ offer.description }}</td>
                <td>{{ offer.zipcode }}</td>
                <td>{{ offer.city }}</td>
                <td>{{ offer.Company }}</td>
                <td>{{ offer.contactEmail }}</td>
                <td>{{ offer.reference }}</td>
                <td>{{ offer.latitude }}</td>
                <td>{{ offer.longitude }}</td>
                <td>
                    <a href=\"{{ path('offer_show', {'id': offer.id}) }}\">show</a>
                    <a href=\"{{ path('offer_edit', {'id': offer.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"12\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>


{% endblock %}
